import React, { useEffect } from 'react';
import { navigate } from '@reach/router';
import axios from 'axios';

const Dashboard = () => {
    useEffect(() => {
        axios.get('http://localhost:8000/api/users', { withCredentials: true })
            .then(res => {
                console.log(res);
            })
            .catch(err => {
                console.log(err);

                if (err !== null) {
                    navigate('/');
                }
            });
    }, []);

    return (
        <div>
            <h1>Dashboard</h1>
        </div>
    )
}

export default Dashboard;
